import React from 'react';
import styled from 'styled-components'
import Feed from '../../HomePage/RightColumn/Feed.jsx'
const RightColumn = () => {

  const Container = styled.div`
    display: flex;
    flex-direction: column;
    width: calc(33% + 1rem);
    border-radius: 15px;
  `;
  return (
    <Container>
      <Feed />
    </Container>
  );
}

export default RightColumn;
